      "tags_section": "Es werden zu Entleihen begehrt",
      "text": "8. Bis den 18ten dis wird eine säugende Hündin begehrt, um etliche junge Hunde zu auferziehen, gegen einer Erkenntlichkeit, wo sich anzumelden ist im Berichtshaus ohne Entgeldt zu vernehmen."
    },
    {
      "date": "1731-01-31",
      "tags_section": "Es werden zum Verleihen offeriert",
      "text": "9. Auf künftige Weyhnacht ist unter der St. Peters-Schul ein geräumiges Magazin zu verleihen, darum sich in dem Schulhauss anzusmelden."
    },
    {
      "date": "1731-01-31",
      "tags_section": "Hingegen wird zu kauff begehrt",
      "text": "1. Es sucht jemand einen silbern Schreibzeug mit aller Zugehördt und schöner Fason, der Liebhaber ist im Berichtshaus zu erfragen."
    },
