      "tags_section": "Hingegen wird zu kauff begehrt",
      "text": "2. Man begehret eine Chaisse mit 4 Rädern zu etwas wann 2 Pläßen und zu einem Pferd samt gehörigem Geschirr, der Liebhaber ist im Berichtshaus ohne Entgeldt zu erfragen."
    },
    {
      "date": "1731-01-31",
      "tags_section": "Hingegen wird zu kauff begehrt",
      "text": "3. Wer hier oder auf dem Land noch neuen Traber-Brandtewein Ohmenweis zu verkaufen hat, kan im Berichtshaus einen Käufer darzu vernehmen, wie auch zu einem mittelmäßigen Sponton, so ebenfahls begehret wird, beydes ohne Entgeldt im Berichtshaus ist zu erfragen."
    },
    {
      "date": "1731-01-31",
      "tags_section": "Hingegen wird zu kauff begehrt",
      "text": "4. Es sucht jemand eine gute, solide und ungefähr einen Saum haltende Feuerspritzen zum tragen oder zum führen, der Liebhaber ist im Berichtshaus zu erfragen."
    },
    {
      "date": "1731-01-31",
      "tags_section": "Hingegen wird zu kauff begehrt",
      "text": "5. Es sucht jemand einen mässigsinen Kron-Leuchter mit 8 Lichtstöcken, der Liebhaber ist im Berichtshaus zu erfragen."
    },
    {
      "date": "1731-01-31",
      "tags_section": "Hingegen wird zu kauff begehrt",
      "text": "6. Es verlangt jemand eine nicht gar grosse eiserne Geld-Kasse zu kaufen, der Liebhaber ist im Berichtshaus zu erfragen."
    },
    {
      "date": "1731-01-31",
      "tags_section": "Hingegen wird zu kauff begehrt",
      "text": "7. Es verlangt jemand einen glatten nussbaumern zweythürigen Kasten, der Liebhaber ist im Berichtshaus zu erfragen."
    },
    {
      "date": "1731-01-31",
      "tags_section": "Hingegen wird zu kauff begehrt",
      "text": "8. Man verlangt einen noch guten Rachel-Ofen mittelmässiger Grösse mit oder ohne Fuss, der Liebhaber ist im Berichtshaus zu erfragen, leidet aber keinen Verzug."
    },
    {
      "date": "1731-01-31",
      "tags_section": "Es wird zum Ausleihen offeriert",
      "text": "1. Ein Losament mitten im Offenburger-Hof, wie der Augenschein zeigen wird, auf nächste Fasnacht- oder Pfingst-Fronfasten zu beziehen."
    },
    {
      "date": "1731-01-31",
      "tags_section": "Es wird zum Ausleihen offeriert",
      "text": "2. Ein sauberes Losament an der Spalen von einer Stuben und Redekammer, oder nach Belieben 2 Kammern samt einem heitern Sommerhaus alles auf einem Boden, und nach Belieben Stallung und Heubühne, auf Pfingst-Fronfasten zu beziehen."
    },
    {
      "date": "1731-01-31",
      "tags_section": "Kost, Information und Bedienungen werden angetragen und begehrt",
      "text": "1. In ein wackeres protestantisches Haus in denen Niederlanden wird ein Candidatus Theologiae, der neben andern auch die französische Sprach verstünde, zu einem Hauss-Präceptor begehrt, weshalb sich im Berichtshaus zu melden."
