      "date": "1731-01-31",
      "tags_section": "Kost, Information und Bedienungen werden angetragen und begehrt",
      "text": "2. Man verlangt einen Menschen in eine Fabrike, der sich zu allerley Hauss-Geschäfften brauschen liesse, im Berichtshaus zu erfragen."
